import React, { useState } from 'react';


export default function SubHeader(props) {
    // Declare a new state variable, which we'll call "count"
    const [title, ToggleTitle] = useState(0);

    return (
       <div>

    <div className="flex bg-gray-200">
        <div className="flex-shrink ">
            <header className="bg-gray-700 shadow">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 max-h-full">
                    <h1 className="text-3xl font-semibold leading-tight text-gray-100">
                        {props.title[title]}
                    </h1>
                    <button onClick={() => ToggleTitle(SwitchTitle(title))}>
                        Click me
                    </button>
                </div>
            </header>
        </div>
        <div className="flex-auto text-gray-900 text-center bg-gray-700 pt-5">
            <div className="rounded-t-lg">Watchlist 1</div>
        </div>
        <div className="flex-auto text-gray-900 text-center bg-gray-700  pt-5 ">
            <div className="rounded-t-lg bg-gray-400  py-5">Watchlist 1</div>
        </div>
        <div className="flex-auto text-gray-900 text-center bg-gray-700">
            <div className="rounded-t-lg">Watchlist 1</div>
        </div>
    </div>

       </div>


    );
}

function SwitchTitle(value){

    if (value == 0){
        value = 1;
    }
        else {
        value = 0
    }
        return value;


}
